import React from 'react';
import HealthIndicator, { HealthBadge } from './HealthIndicator';

const MachineTable = ({ machines, onSelectMachine, loading }) => {
  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-spinner" />
        <div className="loading-text">LOADING MACHINES...</div>
      </div>
    );
  }

  return (
    <div style={{ overflowX: 'auto' }}>
      <table className="data-table">
        <thead>
          <tr>
            <th>MACHINE ID</th>
            <th>TYPE</th>
            <th>HEALTH</th>
            <th>STATUS</th>
            <th>AIR TEMP (K)</th>
            <th>PROC TEMP (K)</th>
            <th>SPEED (RPM)</th>
            <th>TORQUE (Nm)</th>
            <th>TOOL WEAR (min)</th>
            <th>ALERTS</th>
          </tr>
        </thead>
        <tbody>
          {machines.map((m, i) => (
            <tr
              key={m._id || i}
              className="clickable"
              onClick={() => onSelectMachine && onSelectMachine(m.machineId)}
            >
              <td className="machine-id-cell">{m.machineId}</td>
              <td>
                <span style={{
                  fontFamily: 'var(--font-mono)', fontSize: '0.75rem',
                  padding: '0.15rem 0.4rem',
                  background: m.machineType === 'H' ? 'rgba(0,255,157,0.1)' : m.machineType === 'M' ? 'rgba(0,180,255,0.1)' : 'rgba(255,214,0,0.1)',
                  color: m.machineType === 'H' ? 'var(--status-good)' : m.machineType === 'M' ? 'var(--accent-blue)' : 'var(--status-warning)',
                  border: '1px solid currentColor',
                  borderRadius: '2px',
                }}>
                  {m.machineType}
                </span>
              </td>
              <td>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.6rem' }}>
                  <HealthIndicator score={m.healthScore || 0} size="sm" />
                  <span style={{ fontFamily: 'var(--font-mono)', fontSize: '0.85rem', color: 'var(--text-primary)' }}>
                    {m.healthScore || 0}
                  </span>
                </div>
              </td>
              <td><HealthBadge status={m.status || 'GOOD'} /></td>
              <td>{m.airTemperature?.toFixed(1)}</td>
              <td>{m.processTemperature?.toFixed(1)}</td>
              <td>{Math.round(m.rotationalSpeed)}</td>
              <td>{m.torque?.toFixed(1)}</td>
              <td>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem' }}>
                  <div style={{
                    height: '4px', width: '60px', background: 'var(--border)', borderRadius: '2px', overflow: 'hidden',
                  }}>
                    <div style={{
                      height: '100%',
                      width: `${Math.min((m.toolWear / 253) * 100, 100)}%`,
                      background: m.toolWear > 200 ? 'var(--status-critical)' : m.toolWear > 150 ? 'var(--status-poor)' : 'var(--accent-blue)',
                    }} />
                  </div>
                  <span style={{ fontFamily: 'var(--font-mono)', fontSize: '0.75rem' }}>{Math.round(m.toolWear)}</span>
                </div>
              </td>
              <td>
                {(m.alerts || []).length > 0 ? (
                  <span style={{
                    fontFamily: 'var(--font-mono)', fontSize: '0.7rem',
                    color: 'var(--status-critical)', background: 'rgba(255,34,85,0.1)',
                    padding: '0.1rem 0.4rem', borderRadius: '2px', border: '1px solid rgba(255,34,85,0.3)',
                  }}>
                    {m.alerts.length} ALERT{m.alerts.length > 1 ? 'S' : ''}
                  </span>
                ) : (
                  <span style={{ color: 'var(--text-muted)', fontSize: '0.75rem' }}>â€”</span>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MachineTable;
